        {id: 2, title: '', content: '', image: ''},
        {id: 3, title: '', content: '', image: ''},
        {id: 4, title: '', content: '', image: ''}

    ];
    return(
        <div className='ContauctUs'>
            <h2 className='ContauctUs-title'>

            </h2>
            <div>
                <Card className='ContactUs-card'>
                    <Card.Img className='CardImg' src={props.img}></Card.Img>
                </Card>
            </div>
        </div>
    );
};

